import React, { Component } from 'react';
import './Styles/Slider.css'

class Slider extends Component {
    render() {
        return (
            <div id="Slider">
                <div class="slider">
                    <div id="slide1"><span>slide#1</span></div>
                    <div id="slide2"><span>slide#2</span></div>
                    <div id="slide3"><span>slide#3</span></div>
                </div>
                <div class="points">
                    <ul>
                        <li class="active">&bull;</li>
                        <li>&bull;</li>
                        <li>&bull;</li>
                    </ul>
                </div>
                <div class="arrow" id="next" data-dir="next">&raquo;</div>
                <div class="arrow" id="prev" data-dir="prev">&laquo;</div>
            </div>    

        );
    }
}

export default Slider;
